import React from 'react';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const Csr=()=>{
    return(
<>
<Grid container spacing={3}  direction="row"
  justify="center"
  alignItems="center"
>
        <Grid item xs={12} sm={6}>
          <p></p>
        </Grid>
           </Grid>
</>
    );
}

export default Csr;
